import React, { useState } from 'react';
import CreateType from '../components/modals/CreateType';
import CreateBrand from '../components/modals/CreateBrand';

const Admin = () => {
    const [activeType, setActiveType] = useState(false)
    const [activeBrand, setActiveBrand] = useState(false)
    const [activeDevice, setActiveDevice] = useState(false)


    return (
        <div>
            <div style={{width:'100%', alignItems:'center', justifyContent:'center', flexDirection:'column', rowGap:'20px'}} className='d-flex mt-5'>
                <button onClick={()=>setActiveType(true)} style={{width:'250px'}} className='border rounded-4 bg-success text-white fs-5 p-3'>Добавить тип</button>
                <button style={{width:'250px'}} className='border rounded-4 bg-success text-white fs-5 p-3'>Добавить бренд</button>
                <button style={{width:'250px'}} className='border rounded-4 bg-success text-white fs-5 p-3'>Добавить машину</button>  
            </div>
            <CreateType active={activeType} setActive={setActiveType}/>
            <CreateBrand active={activeType} setActive={setActiveType}/>
        </div>
    );
};

export default Admin;
